import { put, takeEvery } from 'redux-saga/effects';
import * as actions from '../actions';


export function* FrontOfficeData() {
    console.log("----------submitting to sagas--------");
    yield put(actions.loadFrontOfficeData.request());
    try {
        console.log("SUCCESS-SAGA_FRONTOFFICE PAGE")
        let objArray = [
            {   id: 1, 
                Title: "Breakfast", 
                SubTitle: "First meal of the day", 
                link: `mainsubcategorypage` 
            },
            {   id: 2, 
                Title: "Brunch", 
                SubTitle: "For late mornings", 
                link:  `services`
            },
            {   id: 3, 
                Title: "Lunch",
                SubTitle: "Light midday meals", 
                link: `services` 
            },
            {   id: 4, 
                Title: " Dinner", 
                SubTitle: "Delicious evening meals", 
                link: `services`
            },
            {   id: 5, 
                Title: " Drinks", 
                SubTitle: "Party starts from here", 
                link: `services` 
            }
        ]
        yield put(actions.loadFrontOfficeData.success(objArray));
    } catch ({ error }) {
        yield put(actions.loadFrontOfficeData.read.failure(error));
    }
}

export function* watchFrontOfficeData() {
    yield takeEvery(actions.LOAD_FRONT_OFFICE, FrontOfficeData);
}

export default watchFrontOfficeData
